package Operators;

public class Relational {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=32,b=65,c=13;
		boolean d= a>b;
		System.out.println(d);
		boolean e=a<b;
		System.out.println(e);
		boolean f=a>=b;
		System.out.println(f);
		boolean g=a<=c;
		System.out.println(g);
		boolean h=a==c;
		System.out.println(h);
		
	}

}
